import styles from "./styles.scss";

export default ({ left, children, right }) => (
  <div className={styles.header}>
    <div className={styles.left}>{left}</div>
    <div className={styles.text}>{children}</div>
    <div className={styles.right}>{right}</div>
  </div>
);
